public int canCompleteCircuit(int[] gas, int[] cost) {
        int N = gas.length;
        int res = 0, min = gas[0] - cost[0], sum = min;
        for (int i = 1; i < N; ++i) {
            sum += gas[i] - cost[i];
            if (sum < min) {
                min = sum;
                res = i;
            }
        }
        return sum >= 0 ? (res + 1) % N : -1;
    }

