public int next() {
        if (node == null) return 0;
        int res = 0;
        while (node != null) {
            if (node.left == null) {
                res = node.val;
                node = node.right;
                return res;
            }
            TreeNode pre = node.left;
            while (pre.right != null && pre.right != node) 
                pre = pre.right;
            if (pre.right == null) {
                pre.right = node;
                node = node.left;
            } else {
                res = node.val;
                node = node.right;
                pre.right = null;
                return res;
            }
        }
        return res;
    }

