public int cal(int[] dp) {
        int N = dp.length;
        Stack<Integer> stk = new Stack<Integer>();
        int i = 0, res = 0;
        while (i < N) {
            if (stk.empty() || dp[i] >= dp[stk.peek()]) {
                stk.push(i++);
                continue;
            }
            int idx = stk.pop();
            int width = stk.empty()?i:(i-stk.peek()-1);
            res = Math.max(res, width*dp[idx]);
        }
        return res;
    }

