public int[][] generateMatrix(int n) {
        if (n <= 0) return new int[0][0];
        int[][] res = new int[n][n];
        int m = n, row = 0, col = -1, num = 0;
        while (true) {
            for (int i = 0; i < m; ++i) res[row][++col] = ++num;
            if (--n == 0) break;
            for (int i = 0; i < n; ++i) res[++row][col] = ++num;
            if (--m == 0) break;
            for (int i = 0; i < m; ++i) res[row][--col] = ++num;
            if (--n == 0) break;
            for (int i = 0; i < n; ++i) res[--row][col] = ++num;
            if (--m == 0) break;
        }
        return res;
    }

