public String longestPalindrome_3(String s) {
        int n = s.length();
        int idx = 0, maxLen = 0;
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j <= 1; ++j) {
                boolean isP = true;
                for (int k = 0; i - k >= 0 && i + j + k < n && isP; ++k) {
                    isP = (s.charAt(i - k) == s.charAt(i + j + k));
                    if (isP && (j + 1 + k*2) > maxLen) {
                        idx = i - k; maxLen = j + 1 + k*2;
                    }
                }
            }
        }
        return s.substring(idx, idx + maxLen);
    }

